import React from "react";

const Navbar = () => {
  return (
    <div className="container flex  max-w-full items-center justify-between border-y-0 border-s-slate-500 bg-slate-700 p-6 shadow-md sm:max-w-full">
      <h1 className="font-bold text-green-400 sm:text-[1rem] lg:text-3xl">REACT APP</h1>
      <ul className="lg hidden text-[15px] text-slate-300 lg:flex">
        <li className="px-2">Home</li>
        <li className="px-2">About</li>
        <li className="px-2">Porfolio</li>
        <li className="px-2">Project</li>
      </ul>
    </div>
  );
};

export default Navbar;
